INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 2, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, 8, 0, "ペコリーヌとの出会い", 91002, 40, "フリーマーケット会場", 2834, "青空の下で謁見", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 2, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, 8, 0, "マホとの出会い", 91002, 40, "フリーマーケット会場", 2835, "未来の騎空団\nマスコット？", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 2, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, 8, 0, "アキノとの出会い", 91002, 40, "ランドソル市街地", 2837, "お嬢さまからの\n緊急依頼", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 2, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, 8, 0, "ジュンとの出会い", 91002, 40, "フリーマーケット会場", 4108402, "黄金色の悩みごと", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 2, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, 8, 0, "カオリとの出会い", 91002, 40, "フリーマーケット会場", 4107402, "白熱！　格闘大会！", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (1, 2, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, 8, 0, "ニノンとの出会い", 91002, 40, "オーエド町", 9000227, "祭り太鼓はオーエドの華", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 3, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, 8, 0, "スズナとの出会い", 91002, 40, "フリーマーケット会場", 2101181, "人気者は遅れて\nやってくる", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 3, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, 8, 0, "ナナカとの出会い", 91002, 40, "ランドソル市街地", 4109402, "巫女・ミーツ・魔法少女", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 3, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, 8, 0, "キャル＆コッコロとの出会い", 91002, 40, "フリーマーケット会場", 4305402, "ネズ耳は二度なくなる", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 3, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, 8, 0, "ユカリとの出会い", 91002, 40, "ランドソル市街地", 4101402, "この出会いにカンパイ！", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 3, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, 8, 0, "アオイとの出会い", 91002, 40, "ランドソル市街地", 4106402, "陰陽アンサンブル", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (1, 3, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, 8, 0, "シノブとの出会い", 91002, 40, "フリーマーケット会場", 2836, "運試し十番勝負！", 10118, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 1, 0, 0, 5118600, 0, 10145115, "オープニング", 0, 0, 0, 0, "彼女たちの新たな日常", 10118, 0);
